  fullName: Netick.OnChangedData.IsCatchingUp
  type: Property
  assemblies:
  - Netick
  namespace: Netick
  summary: >-
    <p>Returns true during the server-authoritative tick in which this client is catching up on an

    already-existing object â€” either because the client has just late-joined,

    or because it has just gained/regained interest in this object.</p>


    <p>This flag is only set for existing objects; it is not set for objects (ones that the client has interest in at spawn time) spawned after the client has joined. 

    It is true only during the "catching up" tick in which the object becomes relevant, 

    and false afterward.</p>


    <p>This flag always returns false on the server.</p>
  example: []
  syntax:
    content: public bool IsCatchingUp { get; }
    parameters: []
    return:
      type: System.Boolean
